import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Future character sheet will generate here!
        </p>
        <a
          className="App-link"
          href="https://dnd.wizards.com/dungeons-and-dragons/start-playing"
          target="_blank"
          rel="noopener noreferrer"
        >
          How to play D&D
        </a>
      </header>
    </div>
  );
}

export default App;
